import { DataGotfetched } from "../lookup";
import React, { useState, setState } from "react";

export function ProductList(){
        const [state, setState] = useState(true)
        const [products, setProducts] = useState([])

        if(state===true){
            setProducts(DataGotfetched())
            setState(false)
        }    
        
        Promise.resolve(products).then((response)=> setProducts(response))
        
        
        return <div>
            <ul>
            {
                products.map(item =>(
                    <li>
                        
                    </li>
                ))
            }
            </ul>
        </div>
}
